import React from 'react'

class Blog extends React.Component {
  constructor(props) {
    super(props)
  }

  render() {
    const blogStyle = {
      paddingTop: 10,
      paddingLeft: 2,
      border: 'solid',
      borderWidth: 1,
      marginBottom: 5
    }

    return (
      <div style={blogStyle}>
        {this.props.title} {this.props.author}
      </div>
    )
  }
}

export default Blog
